package main

import (
	//"bytes"
	//"encoding/json"
	"fmt"
	"io/ioutil"
	"net/http"
)

func main() {
	request, err := http.NewRequest("POST", "https://xxx-xxxx.xxxxx.org/xxxxxxx/xxxxxxxxxxxxx/v1/token/decode", nil)
	if err != nil {
		fmt.Printf("ERORRRRRRRRRRRRRRRRRRRRRRRRRR")
		return
	}

	request.Header.Set("Content-Type", "application/json")
	request.Header.Set("Authorization", "Bearer "+`eyJhbGciOiJSUzI1NiIsInR5cCI6IkpXVCJ9..`)
	client := http.Client{}
	resp, err := client.Do(request)
	if err != nil {
		fmt.Printf("\nError in client do: %+v", err)
		return
	}
	body, err := ioutil.ReadAll(resp.Body)
	if err != nil {
		fmt.Printf("Ioutil read ERR:")
		fmt.Println(err)
		return
	}
	fmt.Printf(string(body))
}

